import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import './App.css';
import Navbar from './Navbar/Navbar';
import Footer from './footer/Footer';
import Home from './Home';
import AboutUs from './Nav-Links/AboutUs';
import ContactUs from './Nav-Links/ContactUs';
import Requirements from './steps/Requirements';
import SchoolOfficer from './steps/SchoolOfficer';
import HeadOfDepartment from './steps/HeadOfDepartment';
import BabcockUniversityTeachingHospital from './steps/BabcockUniversityTeachingHospital';
import DirectorStudentSupportServices from './steps/DirectorStudentSupportServices';
import DirectorSecurityServices from './steps/DirectorSecurityServices';
import DataandArchievesOfficer from './steps/DataandArchievesOfficer';
import AdmissionsOfficer from './steps/AdmissionsOfficer';
import SchoolOfficer2 from './steps/SchoolOfficer2';
import Scrolltotopofsteps from './scrolltotop/scrolltotopofsteps';
import SignUp from './accounts/SignUp';
import LogIn from './accounts/LogIn';
import SelectCourse from './SelectCourse';
import NotFound from './NotFound';
import Computing from "./Computing";
import MassComm from "./MassComm";
import { AuthProvider } from './contexts/AuthContext';
import PrivateRoute from './PrivateRoute';
import Successful from './Successful'
// import ComputingSteps from './ComputingSteps';
import ForgotPassword from './accounts/ForgotPassword';

function App() {
  return (
      <Router>
        <AuthProvider>
        <div className="App">
          <Scrolltotopofsteps />
          <div className="content">
          <Navbar></Navbar>
            <Switch>
              <Route exact path = '/'>
                  <Home />
                  <Footer></Footer>
              </Route>

              <Route path = '/AboutUs'>
                  <AboutUs />
                  <Footer></Footer>
              </Route>

              <Route path = '/ContactUs'>
                  <ContactUs />
                  <Footer></Footer>
              </Route>

              <PrivateRoute path = '/Successful' component = {Successful} />

              <PrivateRoute path = '/Requirements' component = {Requirements} />

              <PrivateRoute path = '/SchoolOfficer' component = {SchoolOfficer} />

              <PrivateRoute path = '/HeadOfDepartment' component = {HeadOfDepartment} />

              <PrivateRoute path = '/BabcockUniversityTeachingHospital' component = {BabcockUniversityTeachingHospital} />

              <PrivateRoute path = '/DirectorStudentSupportServices'  component = {DirectorStudentSupportServices} />

              <PrivateRoute path = '/DirectorSecurityServices'  component = {DirectorSecurityServices} />

              <PrivateRoute path = '/DataandArchievesOfficer'  component = {DataandArchievesOfficer} />

              <PrivateRoute path = '/AdmissionsOfficer'  component = {AdmissionsOfficer} />

             <PrivateRoute path = '/SchoolOfficer2'  component = {SchoolOfficer2} />

              <Route path = '/SignUp' component = {SignUp} />

              <Route path = '/LogIn' component = {LogIn} />

              <Route path = '/ForgotPassword' component = {ForgotPassword} />

              <PrivateRoute path = "/SelectCourse" component = {SelectCourse} />

              <PrivateRoute path = "/Computing" component = {Computing} />

              <PrivateRoute path = "/MassComm" component = {MassComm} />

              {/* <PrivateRoute path = "/ComputingSteps" component = {ComputingSteps} /> */}

              {/* <PrivateRoute path = "/" component = {MassComm} /> */}


              <Route path = "*">
                <NotFound />
              </Route>
            </Switch>
          </div>
        </div>
        </AuthProvider>
      </Router>
  );
}

export default App;
